const NumberList = ({ pageQuantity }) => {
  const array = [];
  // console.log(pageQuantity);
  for (let i = 1; i < pageQuantity.length; i++) {
    array.push(i);
  }
  
  return (
    <ul>
      {array.map((num) => {
        return <li>{num}</li>;
      })}
    </ul>
  );
};
export default NumberList;

